css:
.editor-colors {
  background-color: #002b36;
  color: #839496;
}
.editor .invisible-character,
.editor .indent-guide {
  color: #586e75;
}
.editor .gutter {
  background-color: #073642;
}
.editor .gutter .line-number {
  opacity: 1;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #d33682;
}
.editor .cursor {
  border-color: #fdf6e3;
}
.editor .selection .region {
  background-color: #586e75;
  color: #002b36;
}
.editor .line-number.cursor-line-no-selection {
  background-color: #586e75;
}
.bracket-matcher {
  background-color: #93a1a1;
  opacity: 0.7;
}
.comment {
  color: #586e75;
  font-style: italic;
}
.entity {
  color: #b58900;
}
.keyword {
  color: #859900;
}
.storage.type {
  color: #859900;
}
.constant {
  color: #b58900;
}
.constant.numeric,
.constant.boolean {
  color: #2aa198;
}
.variable {
  color: #268bd2;
}
.delimiter,
.brace {
  color: #dc322f;
}
.delimiter.period {
  color: #859900;
}
.invalid.deprecated {
  text-decoration: underline;
  color: #dc322f;
}
.invalid.illegal {
  color: #dc322f;
}
.string {
  color: #2aa198;
}
.string .constant.character.escape {
  color: #dc322f;
}
.string.regexp {
  color: #2aa198;
}
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #dc322f;
}
.editor .wrap-guide {
  background: #252B39;
}
.editor .indent-guide {
  color: #38405B;
}
.editor {
  background-color: #252B39;
  color: #C3CEE3;
}
.editor .gutter {
  background-color: #252B39;
  color: #5D758E;
  box-shadow: 3px 0px 3px rgba(0, 0, 0, 0.5);
}
.editor.is-focused .cursor {
  border-color: #F8F8F0;
}
.editor.is-focused .selection .region {
  background-color: #080A0D;
}
.editor.is-focused .line-number.cursor-line-no-selection,
.editor.is-focused .line.cursor-line {
  background-color: #384057;
}
.editor .line-number {
  color: #747C8E;
}
.editor .comment {
  color: #5A7BBE;
}
.editor .string {
  color: #D5D5CA;
}
.editor .constant.numeric {
  color: #EF8A8C;
}
.editor .constant.language {
  color: #EF8A8C;
}
.editor .constant.character,
.editor .constant.other {
  color: #EF8A8C;
  font-weight: bold;
}
.editor .brace {
  color: #C3CEE3;
}
.editor .keyword {
  color: #9697DD;
}
.editor .operator {
  color: #FFF;
}
.editor .storage {
  color: #C299B6;
}
.editor .storage.type {
  font-style: italic;
  color: #C2AFC5;
}
.editor .entity.name.class {
  color: #DFB5A5;
}
.editor .entity.other.inherited-class {
  color: #DFB5A5;
}
.editor .entity.name.function {
  color: #8BE9EE;
}
.editor .variable.parameter {
  font-style: italic;
  color: #77D9C6;
}
.editor .definition.tag.html {
  color: #5767B0!important;
}
.editor .name.tag.html {
  color: #70AAFD!important;
}
.editor .entity.name.tag {
  color: #F92672;
}
.editor .entity.other.attribute-name {
  color: #7FD1FB;
}
.editor .support.function {
  color: #66D9EF;
}
.editor .support.constant {
  font-weight: bold;
  color: #E59494;
}
.editor .support.type,
.editor .support.class {
  color: #E3C78A;
}
.editor .invalid {
  color: #F8F8F0;
  background-color: #F92672;
}
.editor .invalid.deprecated {
  color: #F8F8F0;
  background-color: #AE81FF;
}
.editor .regex {
  color: #25C3CF;
}
